import React from 'react'
import { Link } from 'react-router-dom'
import style from '../Landing/landing.module.css'

const Landing = () => {
  return (
    <div className={style.background}>
      <button>
        <Link to={'/home'}>Home</Link>
      </button>
      
    </div>
  )
}

export default Landing
